import org.apache.commons.io.IOUtils
import java.nio.charset.*
 def flowFile = session.get();
if (flowFile == null) {
 return;
}
def slurper = new groovy.json.JsonSlurper()
def attrs = [: ] as Map < String, String >

 session.read(flowFile, {
   inputStream ->
   def text = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
   def obj = slurper.parseText(text)
   obj.each {
    k,
    v ->
    if (v instanceof Map) {
     v.each {
      key,
      value ->
      attrs[k + "_" + key] = value.toString()
     }
    } else {


     if (k == 'flow_name') {
      attrs[k] = attrs[k] + "_LB"
     }


     attrs[k] = v.toString()
    }


   }







  }
  as InputStreamCallback)

mode = "success"

flowFile = session.putAllAttributes(flowFile, attrs)
int delay_toint = java.text.NumberFormat.instance.parse(attrs['delay'])
if (('delay' in attrs) && (delay_toint > 0)) {

 delay_counter = flowFile.getAttribute('delay_counter')
 if (delay_counter == null) {
  flowFile = session.putAttribute(flowFile, 'delay_counter', '1')
  mode = "first_fail"
 } else {
    delay_counter = java.text.NumberFormat.instance.parse(delay_counter)


  if (delay_counter > delay_toint-1) {


   mode = "success"
   ////////flowFile = session.putAttribute(flowFile, 'count_log', "delay_counter: " + delay_counter + " is BIGGER than delay_toint: " + delay_toint)



  } else {


   delay_counter++
   mode = " incrementing " + delay_toint + ", " + delay_counter
   flowFile = session.putAttribute(flowFile, 'delay_counter', delay_counter.toString())

  }
 }



}


if (mode == "success") {
 ////////flowFile = session.putAttribute(flowFile, 'mode', mode)
 //flowFile = session.putAllAttributes(flowFile, attrs)
 session.transfer(flowFile, REL_SUCCESS)
} else {
 attrs['mode'] = attrs['mode'] + " " + mode
 //////////////flowFile = session.putAttribute(flowFile, 'mode', attrs['mode'])
 //flowFile = session.putAllAttributes(flowFile, attrs)
 flowfile = session.penalize(flowFile)
 session.transfer(flowFile, REL_FAILURE)
 return
}
